const bgColor = '#fafafa';

const classes = {
    secondaryText: {
        value: '#aaa'
    },
    container: {
        position: 'absolute',
        top: '0',
        left: '0',
        padding: '0',
        backgroundColor: bgColor,
        zIndex: '-5',
        maxWidth: 'none !important',
        height: '100vh'
    },
    miniContainer: {
        marginTop: '50px'
    },
    lineHolder: {
        display: 'flex',
    },
    horizontalLine: {
        height: '1px',
        backgroundColor: secondaryText.value,
        flex: 'flex-start'
    }
}

export {classes}
